textOriginal:
Temos que escolher o menos pior, eu só não ficar criticando qualquer coisinha que o presidente faz, tipo;

Se aliar ao Collor;
Botar Petista no STF;
“Não sou coveiro idai”;
Gasolina chegar a 8 reais; 
Dólar era 3,40 foi pra 5,50;
Inflação de 2 dígitos; 
Rachadinha;
Orçamento secreto;
Aumento de indicações pro STF;
Usar a fe das pessoas pra se promover 
Imprimir 40 bilhões a 2 meses da eleição pra criar auxílios insustentáveis pra ganhar votos;
Mentir descaradamente sobre o Centrão entre outras várias coisas…
Mas também né onde lá se viu criticar qualquer coisinha, temos que apoiá-lo porque senão o Pete volta
